import React, { useEffect, useRef } from 'react';
import * as THREE from 'three';
import { GLTFLoader } from 'three/examples/jsm/loaders/GLTFLoader';
import { OrbitControls } from 'three/examples/jsm/controls/OrbitControls';
import './App.css';

const App = () => {
  const containerRef = useRef(null);

  // Initialize 3D scene on component mount
  useEffect(() => {
    const container = containerRef.current;
    const width = container.offsetWidth;
    const height = container.offsetHeight;

    // Scene setup
    const scene = new THREE.Scene();
    const camera = new THREE.PerspectiveCamera(75, width / height, 0.1, 1000);
    const renderer = new THREE.WebGLRenderer({ antialias: true, alpha: true });
    renderer.setSize(width, height);
    renderer.setClearColor(0x000000, 0); // Transparent background
    container.appendChild(renderer.domElement);

    // Lighting setup
    const ambientLight = new THREE.AmbientLight(0xF5E8C7, 0.7); // Soft ambient light
    scene.add(ambientLight);
    const pointLight = new THREE.PointLight(0xD4A017, 1.5, 100); // Warm directional light
    pointLight.position.set(5, 5, 5);
    scene.add(pointLight);

    // Load 3D model
    const loader = new GLTFLoader();
    loader.load(
      `${process.env.PUBLIC_URL}/models/base_basic_shaded.glb`,
      (gltf) => {
        const model = gltf.scene;
        model.position.set(0, 0, 0);
        model.scale.set(1.2, 1.2, 1.2); // Slightly larger for emphasis
        scene.add(model);
      },
      undefined,
      (error) => console.error('Model loading error:', error)
    );

    // Camera positioning
    camera.position.set(0, 2, 5);

    // Orbit controls for interactivity
    const controls = new OrbitControls(camera, renderer.domElement);
    controls.enableDamping = true;
    controls.dampingFactor = 0.05;
    controls.minDistance = 2;
    controls.maxDistance = 10;

    // Animation loop
    const animate = () => {
      requestAnimationFrame(animate);
      controls.update();
      renderer.render(scene, camera);
    };
    animate();

    // Handle window resize
    const handleResize = () => {
      const newWidth = container.offsetWidth;
      const newHeight = container.offsetHeight;
      camera.aspect = newWidth / newHeight;
      camera.updateProjectionMatrix();
      renderer.setSize(newWidth, newHeight);
    };
    window.addEventListener('resize', handleResize);

    // Cleanup
    return () => {
      window.removeEventListener('resize', handleResize);
      container.removeChild(renderer.domElement);
      renderer.dispose();
    };
  }, []);

  return (
    <div className="app">
      {/* Navigation Bar */}
      <nav className="navbar">
        <div className="logo">Machina</div>
        <ul className="nav-links">
          <li><a href="#home">Home</a></li>
          <li><a href="#design">Design</a></li>
          <li><a href="#performance">Performance</a></li>
          <li><a href="#experience">Experience</a></li>
          <li><a href="#contact">Contact</a></li>
        </ul>
      </nav>

      {/* Hero Section */}
      <section className="hero">
        <video autoPlay muted loop className="hero-video">
          <source src={`${process.env.PUBLIC_URL}/images/australia.mp4`} type="video/mp4" />
          Your browser does not support the video tag.
        </video>
        <div className="hero-content">
          <h1>Mach-E Machina</h1>
          <p>Redefine Velocity</p>
          <button className="discover-btn">Discover Now</button>
        </div>
        <div className="model-3d" ref={containerRef}></div>
      </section>

      {/* Additional Content Section */}
      <section className="content-section">
        <img
          src={`${process.env.PUBLIC_URL}/images/mache.png`}
          alt="Machina Full View"
          className="side-image"
        />
        <video autoPlay muted loop className="side-video">
          <source src={`${process.env.PUBLIC_URL}/images/648400757847749.mp4`} type="video/mp4" />
          Your browser does not support the video tag.
        </video>
      </section>
    </div>
  );
};

export default App;
